%script

-- DELETE PREVIOUS DATA IF IT EXISTS
BEGIN 
  BEGIN
       EXECUTE IMMEDIATE 'DROP TABLE EXT_CUSTOMER_INSURANCE_LTV';
       EXCEPTION WHEN OTHERS THEN NULL;
  END;
  BEGIN
       EXECUTE IMMEDIATE 'DROP TABLE CUSTOMER_INSURANCE_LTV';
       EXCEPTION WHEN OTHERS THEN NULL;
  END;
  BEGIN
       EXECUTE IMMEDIATE 'DROP TABLE CUSTOMER_INSURANCE_LTV_NOISE';
       EXCEPTION WHEN OTHERS THEN NULL;
  END;
   BEGIN
       EXECUTE IMMEDIATE 'DROP TABLE CUSTOMER_INSURANCE_LTV_SQL';
       EXCEPTION WHEN OTHERS THEN NULL;
  END;
  BEGIN
       EXECUTE IMMEDIATE 'DROP TABLE CUSTOMER_INSURANCE_LTV_PY';
       EXCEPTION WHEN OTHERS THEN NULL;
  END;
END;

%script

BEGIN 
    INSERT INTO CUSTOMER_INSURANCE_LTV_NOISE
    SELECT * FROM CUSTOMER_INSURANCE_LTV 
    WHERE ORA_HASH(CUSTOMER_ID, 13, 10) = 0
    FETCH FIRST 1000 ROWS ONLY;
    COMMIT;
END;

%script

BEGIN
    UPDATE CUSTOMER_INSURANCE_LTV_NOISE
    SET MARITAL_STATUS = 'DIV'
    WHERE CUSTOMER_ID >= 'CU3' and CUSTOMER_ID < 'CU4'
          AND MARITAL_STATUS = 'DIVORCED';

    COMMIT;

    UPDATE CUSTOMER_INSURANCE_LTV_NOISE
    SET MARITAL_STATUS = 'M'
    WHERE CUSTOMER_ID >= 'CU3' and CUSTOMER_ID < 'CU4'
          AND MARITAL_STATUS = 'MARRIED';

    COMMIT;
END;

%script

CREATE TABLE CUSTOMER_INSURANCE_LTV_SQL AS SELECT * FROM CUSTOMER_INSURANCE_LTV_NOISE;
CREATE TABLE CUSTOMER_INSURANCE_LTV_PY AS SELECT * FROM CUSTOMER_INSURANCE_LTV_NOISE;
